// Recursive
function consistently(fns) {
  if(fns.length === 0) return Promise.resolve(0);
  
  const [fn, ...otherFns] = fns
  
  return fn()
      .then(res => consistently(otherFns)
        .then(allRes => allRes + res))
}
  


