#include <bits/stdc++.h>

using namespace std;

long long n, k, s;

long long go(long long x, long long d) {
    if (x + d <= n)
        return x + d;
    return x - d;
}

int main() {
    cin >> n >> k >> s;

    if (k * (n - 1) < s || k > s) {
        cout << "NO";
        return 0;
    }

    cout << "YES\n";
    int cur = 1;
    while (true) {
        long long d = min(n - 1, s - (k - 1));
        cur = go(cur, d);
        s -= d;
        k--;
        cout << cur << ' ';
        if (k == 0)
            break;
    }
}

#include <bits/stdc++.h>

using namespace std;

long long n, k, s;

long long go(long long x, long long d) {
    if (x + d <= n)
        return x + d;
    return x - d;
}

int main() {
    cin >> n >> k >> s;

    if (k * (n - 1) < s || k > s) {
        cout << "NO";
        return 0;
    }

    long long d = s / k;
    long long y = s % k; // y шагов по (d + 1)
    long long x = k - y; // x шагов по d

    cout << "YES\n";
    int cur = 1;
    while (y--) {
        cur = go(cur, d + 1);
        cout << cur << ' ';
    }
    while (x--) {
        cur = go(cur, d);
        cout << cur << ' ';
    }
}

#include <bits/stdc++.h>

using namespace std;

string a[105];
int n;

bool cmp(string x, string y) {
    if (x.size() < y.size())
        return 1;
    return 0;
}

bool check(string x, string y) {
    int n = x.size(), m = y.size();
    for (int i = 0; i < m; i++) {
        bool ok = 1;
        for (int j = 0; j < n; j++) {
            if (x[j] != y[i + j]) {
                ok = 0;
            }
        }
        if (ok)
            return true;
    }
    return false;
}

int main() {
    cin >> n;

    for (int i = 1; i <= n; i++)
        cin >> a[i];

    sort(a + 1, a + n + 1, &cmp);

    for (int i = 1; i < n; i++) {
        if (check(a[i], a[i + 1]) == false) {
            cout << "NO\n";
            return 0;
        }
    }

    cout << "YES\n";
    for (int i = 1; i <= n; i++)
        cout << a[i] << '\n';
}

